import oppo from '../Images/oppo.jpg';
import Button from 'react-bootstrap/esm/Button';
import React  from 'react';

function Oppo() {
    return (
        <div className="Product">
            <div className='oppo1'>
                <img src={oppo} alt="Image" className='button' />

                <Button variant="warning" className='oppo_confirm' >Confirm</Button>
            </div>
            <div className='product2'>
                <b>About this item</b><br></br>
                <b>•</b> 6.56" inch (16.66cm) HD+ Premium Leather-Feel Design and Colour Rich Display
                with 1612x720 pixels | IPX4 Water Resistant | Side Fingerprint Sensor<br></br><br></br>
                <b>•</b> 4 GB RAM (Up to 4GB Extended RAM)| 64 GB ROM | Dual Sim Slot + Micro SD with MediaTek
                Helio G35 processor and long lasting 5000 mAh Battery<br></br><br></br>
                <b>•</b>5MP Front Camera | 50MP + 0.3MP Rear AI Dual Rear Camera<br></br>
            </div>


        </div>



    );
}
export default Oppo;
